import CarService from '../../services/CarService';

export {};

async function fetchCarData() {
  try {
    const carData = await CarService.getCarsTwo();
    // Do something with the car data, such as storing it in state or passing it to components
    return carData;
  } catch (error) {
    console.error('Error fetching car data:', error);
    return []; // Return empty array or handle the error accordingly
  }
}

fetchCarData().then(carData => {
  // Do something with the fetched car data
 // console.log(carData);
});

export interface Car {
  _id: string;
  brand: string;
  model: string;
  seats: number;
  category: string;
  horsepower: number;
  seatsCount: number;
  fuelType: string;
  price: number;
  link: string;
}

const carData = null;

export default carData;
